import React from 'react';
import Navbar from './components/Navbar';
import { Switch, Route } from 'react-router-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <> 
    <Router>
     <Navbar/> 
     <Switch>
      <Route path='/' exact/>
     </Switch>
    </Router>

</>
  );
}

export default App;
